CREATE FUNCTION electronic_log.prevent_edit_if_completed() RETURNS trigger
    LANGUAGE plpgsql
    AS $$
BEGIN
    IF (NEW.extraction_status = 'Completed' AND NEW.user_role != 'superuser') THEN
        RAISE EXCEPTION 'Only superusers can edit when status is "Completed"';
    END IF;
    RETURN NEW;
END;
$$;


